import React from "react";
import "./main.css";

const Gallery_box = () => {
  return (
    <div>
      <div class="box" data-aos="zoom-in">
        <img src="img/images/pack_img/1.jpeg" alt="" />
        <div class="content">
          <h3>Goa</h3>
          <p>
            The top sightseeing places in Goa are Calangute Beach, Basilica of
            Bom Jesus and more...
          </p>
        </div>
      </div>
    </div>
  );
};

export default Gallery_box;
